**Description**
I've compiled a CLIP text embedding into an ONNX model (after some tweaking to make it ONNX compatible- see https://github.com/openai/CLIP/pull/219) then quantized to fp16.
Now, when I run the ONNX model with TensorRT optimization, the result I see from Triton is just too far off from when I do CLIP text embedding directly with their code (seeing some 0.77 norm difference after normalization). Without TensorRT, in both CPU and GPU, I see a reasonably close value (<0.01 norm difference), so it seems highly suggestive of an issue with TensorRT.
Could be related to https://github.com/NVIDIA/TensorRT/issues/1839

**Triton Information**
What version of Triton are you using? r22.02 container

Are you using the Triton container or did you build it yourself? Using the container.

**To Reproduce**
Steps to reproduce the behavior.
1. Compile text embedding ONNX model

```python
import clip
import clip.model
import torch
from onnxruntime.tools.symbolic_shape_infer import SymbolicShapeInference
from torch import nn


class ClipTextFeatureNet(nn.Module):

    def __init__(self, clip_model: clip.model.CLIP):
        super(ClipTextFeatureNet, self).__init__()
        self.clip_model = clip_model

    def forward(self, text):
        text_encoding = self.clip_model.encode_text(text)
        text_features = text_encoding / text_encoding.norm(dim=1, keepdim=True)
        return text_features


output='out.onnx'
clip_model, clip_preprocessor = clip.load('ViT-B/32', device='cpu')
feature_net = ClipTextFeatureNet(clip_model)

# Build test input by tokenizing test text input.
with open("test_text/test.txt") as file:
    test_text = file.readlines()
dummy_input = dummy_input.type(torch.IntTensor)

temp_output = f"{output}_temp"
torch.onnx.export(feature_net,
                  dummy_input,
                  temp_output,
                  export_params=True,
                  input_names=["TEXT_TOKENS"],
                  output_names=["TEXT_EMBEDDING"],
                  opset_version=14,
                  dynamic_axes={
                      "TEXT_TOKENS": {
                          0: "batch_size"
                      },
                      "TEXT_EMBEDDING": {
                          0: "batch_size"
                      },
                  })

temp_model = onnx.load(temp_output)
out_mp = SymbolicShapeInference.infer_shapes(temp_model)
onnx.save(out_mp, output)
```

2. Quantize to fp16
3. Test passes for comparison between original model and fp16 ONNX model when not running on TensorRT.
4. Build triton repository with the resulting onnx model and TensorRT optimization
5. Issue infer call and compare the result with CLIP native result

